import{_ as r,o,c as t,z as e,a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 15.2-3223 What order and proceedings clerk to certify, and where same shall be recorded; fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/15.2-3223.md","filePath":"vacode/15.2-3223.md"}'),s={name:"vacode/15.2-3223.md"},c=e("h1",{id:"§-15-2-3223-what-order-and-proceedings-clerk-to-certify-and-where-same-shall-be-recorded-fees",tabindex:"-1"},[a("§ 15.2-3223 What order and proceedings clerk to certify, and where same shall be recorded; fees. "),e("a",{class:"header-anchor",href:"#§-15-2-3223-what-order-and-proceedings-clerk-to-certify-and-where-same-shall-be-recorded-fees","aria-label":'Permalink to "§ 15.2-3223 What order and proceedings clerk to certify, and where same shall be recorded; fees."'},"​")],-1),d=e("p",null,"The clerk of the court wherein an order is entered for the annexation of territory shall make and certify copies of so much of the order and proceedings as shall show the authorization of the transfer of territory from the county or town to the city or town, as the case may be. He shall transmit one copy, along with a full description of the territory so annexed, to the county clerk of the county whose territory is affected, who shall forthwith record the same in the name of the city or town to which the territory is annexed, and one copy to the clerk of the court of such city in which deeds are recorded, who shall likewise record and index the same. The fees of the clerk for such recordation shall be the same as for recording a deed and such fees, as well as the fees of the clerk for making the copies aforesaid, shall be paid by the city or town.",-1),h=e("p",null,"Code 1950, § 15-152.21; 1952, c. 328; 1962, c. 623, § 15.1-1051; 1997, c. 587.",-1),n=[c,d,h];function i(l,f,m,p,w,y){return o(),t("div",null,n)}const k=r(s,[["render",i]]);export{u as __pageData,k as default};
